import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css'; // Import CSS here or in index.js

function App() {
  return (
    <Router>
      <div id="root">
        <nav>
          <Link to="/">Home</Link>
          <Link to="/tasks">Tasks</Link>
          <Link to="/calendar">Calendar</Link>
        </nav>
        {/* Your Routes */}
      </div>
    </Router>
  );
}

export default App;
